import React from 'react';
import '.././style/App.css';

class Movies extends React.Component {
  render(){
    return(
      <div>
        <div class="titre">
          <p>
            Popular Movies
          </p>
        </div>

          <div className="spinner-border text-primary" role="status">
            <span className="sr-only">
              Loading...
            </span>

        </div>

      </div>
    );
  }
}

export default Movies;
